import { Link } from "react-router-dom";
//link 

const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>TayeAlabi Blog</h1>
      <div className="links">
        <Link to="/">Home</Link>
        <a href="/create">New Blog</a>
      </div>
    </nav>
  );
};

export default Navbar;
